import React, {Component} from 'react';
import './Login.css';

class Login extends Component {
    render() {
        return (
            <div className="Login">
                <h1>Lift Weights<br />Lose Weight!</h1>

                <p>
                    <input id="name" type="text" />
                    <input id="password" type="password" />
                    <button id="login">Login</button>
                </p>
            </div>
        );
    }
}

export default Login;
